	add("bridget", "{\"term\":\"bridget\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"English form of the Irish saints\u0027 name \u0027Brighid\u0027, \u0027Brigid\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Scene II\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"and when Mistress \u0027\u0027Bridget\u0027\u0027 lost the handle of her fan, I took\u0027t upon mine honour thou hadst it not\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 David Pierce: \u0027Irish Writing in the Twentieth Century: A Reader\u0027. Cork University Press. ISBN 1859182585 pages 8-9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Of all the beautiful Christian names of women which were in use a century or two ago Brighid (Breed) , under the ugly form of \u0027\u0027Bridget\u0027\u0027, or still worse, Biddy, and Eiblin under the form of Eveleen, and perhaps Norah, seem to be the only survivals, and they are becoming rarer\", \"priority\":4}]}, \"synonyms\":{}}");

