	add("brigand", "{\"term\":\"brigand\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) circa 1400, from Old french (842-ca. 1400) \u0027brigand\u0027 (foot soldier) attested from 1421, from Latin {{m|la|brigō||to fight}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outlaw or bandit\", \"priority\":1}]}, \"synonyms\":{}}");

