	add("brigandine", "{\"term\":\"brigandine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027brigandine\u0027 from \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coat of armor for the body, consisting of scales or plates, sometimes overlapping each other, generally of metal, and sewn to linen or other material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Harness the horses; and get up, ye horsemen, and stand forth with your helmets; furbish the spears, and put on the \u0027\u0027brigandines\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1786\u0027\u0027, Francis Grose, \u0027A Treatise on Ancient Armour and Weapons\u0027, page 19\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027brigandine\u0027\u0027 takes its name from the troops, by which it was first worn, who were called brigans, they were a kind of light armed irregular foot, much addicted to plunder, whence it is probable the appellation of brigands was given to other freebooters\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027A Storm of Swords\u0027, Bantam 2011, p. 176\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Red-haired and freckled, he wore a studded \u0027\u0027brigantine\u0027\u0027, high boots, fingerless leather gloves, and a quiver on his back\", \"priority\":6}]}, \"synonyms\":{}}");

	add("brightness", "{\"term\":\"brightness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bright|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being bright\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHere, in the transept and choir, where the service was being held, one was conscious every moment of an increasing \u0027\u0027brightness\u0027\u0027; colours glowing vividly beneath the circular chandeliers, and the rows of small lights on the choristers\u0027 desks flashed and sparkled in front of the boys\u0027 faces, deep linen collars, and red neckbands\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The perception elicited by the luminance of an object\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Intelligence, cleverness\", \"priority\":4}]}, \"synonyms\":{}}");

	add("brightwork", "{\"term\":\"brightwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Polished metal fixtures, especially aboard a boa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The varnished or oiled wood trim aboard a boat\", \"priority\":2}]}, \"synonyms\":{}}");

	add("brigue", "{\"term\":\"brigue\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French French|brigue\u0027, of uncertain origin. Compare Italian \u0027briga\u0027, Spanish \u0027brega\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intrigue, secretive machinations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brilliance", "{\"term\":\"brilliance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being exceptionally effulgent (giving off light\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality of having extraordinary mental capacity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Magnificence; resplendence\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brilliancy", "{\"term\":\"brilliancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|brilliant|cy|lang\u003den}} or {{suffix|brilliance|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a shining quality; brilliance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act of being brilliant\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A spectacular and beautiful game of chess, generally featuring sacrificial attacks and unexpected moves\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brilliantness", "{\"term\":\"brilliantness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being brilliant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brillig", "{\"term\":\"brillig\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Supposedly from \u0027\u0027 or \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A nonce word in \u0027s \u0027\u0027, explained by Humpty Dumpty as \u0026quot;four o\u0027clock in the afternoon \u0026amp;mdash; the time when you begin broiling things for dinner.\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"\u0027Twas \u0027\u0027brillig\u0027\u0027, and the slithy toves / Did gyre and gimble in the wabe\u0027 \u0026amp;mdash; Lewis Carroll, \u0027Jabberwocky\", \"priority\":2}]}, \"synonyms\":{}}");

	add("brine", "{\"term\":\"brine\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"West Frisian\", \"Latin\", \"Dutch\", \"Sanskrit\", \"old irish (to 900)\", \"Slovene\", \"Albanian\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|brȳne}}, from Proto-germanic {{m|gem-pro|*brein-}} (compare West frisian \u0027brein\u0027 Dutch \u0027brein\u0027 , from Proto-indo-european {{m|ine-pro|*bʰreHi-||to cut, maim}} (compare Old irish (to 900) \u0027ro·bria\u0027 (may hurt, damage) Latin \u0027friāre\u0027 (to rub, crumble) Slovene \u0027bríti\u0027 (to shave, shear) Albanian \u0027brej\u0027 (to gnaw) Sanskrit \u0027बृणाति|tr\u003dbhrīṇā́ti\u0027 (they injure, hurt)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Salt water; water saturated or strongly impregnated with salt; a salt-and-water solution for pickling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dPhilander went into the next roomand came back with a salt mackerel that dripped \u0027\u0027brine\u0027\u0027 like a rainstorm. Then he put the coffee pot on the stove and rummaged out a loaf of dry bread and some hardtack\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The sea or ocean; the water of the sea\", \"priority\":3}]}, \"synonyms\":{}}");

