	add("bringer", "{\"term\":\"bringer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who, or a thing which brings somethin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yet the first \u0027\u0027bringer\u0027\u0027 of unwelcome news / Hath but a losing office\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brinicle", "{\"term\":\"brinicle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|brine|icicle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formation of frozen brine, occurring beneath sea ice and analogous to a stalactite\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brinny", "{\"term\":\"brinny\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From w:Aboriginal Australian languages|Aboriginal Australian.{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stone thrown as a missile.\u0026lt;ref\u0026gt;\u0027\u00271978\u0027\u0027, Sidney John Baker, \u0027The Australian Language\u0027, %22brinnie%22|%22brinnies%22+yonnie+OR+yonny+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22brinny%22|%22brinnie%22|%22brinnies%22+yonnie+OR+yonny+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5RYHT4-HJem8iAeQqPWjCQ\u0026amp;redir_esc\u003dy page 285] — One of the cheapest of all juvenile games is stone-throwing. Depending on local preferences, a stone is a \u0027goalie\u0027, \u0027quailer\u0027, \u0027gibber\u0027, \u0027yonnie\u0027, \u0027ronnie\u0027, \u0027brick\u0027, \u0027brinny\u0027, \u0027cundy\u0027 or \u0027boondie\u0027.\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brioche", "{\"term\":\"brioche\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of light sweet pastry or bun of French origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A knitted cushion for the feet\", \"priority\":2}]}, \"synonyms\":{}}");

	add("briquet", "{\"term\":\"briquet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027briquette\u0027 diminutive of \u0027brique\u0027 (brick)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a small brick, typically made of charcoal and typically used for fue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1911,\u0027\u0027 F. H. King, \u0027Farmers of Forty Centuries\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Another pinch of charcoal was added and the process repeated until the mold was filled, when the briquet was forced out\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A block of artificial stone in the form of a brick, used for paving\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A moulded sample of solidified cement or mortar for use as a test piece for showing the strength of the material\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"obsolete?\u0027) a cigarette lighte\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1919,\u0027\u0027 John Galsworthy, \u0027Saint\u0027s Progress\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Out of the corner of his eye he caught the flash of a man\u0027s \u0026quot;\u0027\u0027briquet\u0027\u0027\u0026quot; lighting a cigarette\", \"priority\":8}]}, \"synonyms\":{}}");

	add("brise", "{\"term\":\"brise\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tract of land that has been left untilled for a long time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1616\u0027\u0027: Richard Surflet [tr.] and Gervase Markham [aug.], \u0027Estienne and Liébault’s Maison Rustique, or The Countrie Farme\u0027, page 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Afterward let him draw a \u0027\u0027Brise\u0027\u0027 or two made fast in the yoke\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brisance", "{\"term\":\"brisance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027brisant\u0027 present participle of \u0027briser\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The shattering effect of the energy released in an explosion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 985\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He thought he knew being aflame. But this was sustained explosion, reaching now and then a quite unendurable \u0027\u0027\u0027brisance\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brisbanian", "{\"term\":\"brisbanian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Brisbane|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or inhabitant of Brisbane (Australia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brisbanite", "{\"term\":\"brisbanite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Brisbane|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or inhabitant of Brisbane (Australia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("briskness", "{\"term\":\"briskness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From brisk + -ness\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being brisk\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bristlemouth", "{\"term\":\"bristlemouth\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bristle|mouth|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of Gonostomatidae, a family of deep-water marine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of one of several of the species of oceanic ray-finned fish in genera or in the family\", \"priority\":2}]}, \"synonyms\":{}}");

	add("bristol", "{\"term\":\"bristol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Portuguese\"], \"text\":\"From English {{m|en|Bristol}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A city and county in south-west England bordering Gloucestershire, Somerset and The River Severn\", \"priority\":1}]}, \"synonyms\":{}}");

	add("britannia", "{\"term\":\"britannia\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"ancient greek (to 1453)\", \"Latin\", \"old irish (to 900)\"], \"text\":\"{{slim-wikipedia|Britain (name)|lang\u003den}}{{slim-wikipedia|Britannia|dab\u003dBritannia (discretiva)|lang\u003dla}}As {{m|la|Brittānia}} from the 1st century BC, from Ancient greek (to 1453) \u0027πρεττανια\u0027 used by {{w|Diodorus}}, earlier \u0027\u0027 (νῆσος) \u0027\u0027 (πρεττανική) or \u0027\u0027 (βρεττανίαι) used by {{w|Pytheas}} (4th century BC) of the entire archipelago now known as the British Isles.The Ancient Greek name is ultimately from a Celtic ethnonym, reconstructed as early British Celtic *\u0027Pritani\u0027, perhaps from a Proto-celtic {{m|cel-pro|*kʷritanī}}, {{m|cel-pro|*kʷritenī}}, whence Welsh \u0027prydyn\u0027 (picts) Old irish (to 900) \u0027cruthne\u0027 \u0027cru(i)then-túath\u0027 (picts)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a female personification of Britai\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1740\u0027\u0027, James Thomson (\u0027lyrics\u0027), Thomas Arne (\u0027music\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Rule, \u0027\u0027Britannia\u0027\u0027! \u0027\u0027Britannia\u0027\u0027 rule the waves / Britons never, never shall be slaves\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A settlement in Newfoundland and Labrador\", \"priority\":4}]}, \"synonyms\":{}}");

	add("britart", "{\"term\":\"britart\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|Brit|art|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The work of w:Young British Young British Artists, a group of conceptual artists, painters, sculptors and installation artists based in the United Kingdom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("britfag", "{\"term\":\"britfag\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Brit|fag|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from the United Kingdom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"you get, you fucking 6,000 B.C. faggots\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"and kowtowed to the faggot Stuart queens like James I, and Charles Iand II\", \"priority\":3}]}, \"synonyms\":{}}");

	add("british", "{\"term\":\"british\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"In Old english (ca. 450-1100) as \u0027bryttisc\u0027 (britons) [http://www.etymonline.com/index.php?search\u003dBritish].The spelling with single \u0027-t-\u0027 appears in the 13th century under the influence of Latin \u0027Britannia\u0027, but spelling with \u0027-tt-\u0027 persists alongside \u0027-t-\u0027 during the 13th to 17th centuries.In reference to the island of Great Britain from ca. 1400 (Latin \u0027natio Anglica sive Britannica\u0027, \u0027Brittisshe occean\u0027 1398, \u0027the Britishe nacion\u0027 1548).As a noun, referring to the British people, British soldiers, etc. from ca. 1600.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"With \u0027the\u0027, the citizens or inhabitants of Britain collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"With \u0027the\u0027, the citizens or inhabitants of the United Kingdom collectively\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The ancient inhabitants of the southern part of Britain before the Anglo-Saxon invasion, also called ancient Britons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Celtic language of the ancient Briton\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The British English language\", \"priority\":5}]}, \"synonyms\":{}}");

	add("britisher", "{\"term\":\"britisher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|British|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Briton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027, \u0027The Life of a Sailor\u0027, J. \u0026amp; J. Harper, [http://books.google.com/books?id\u003d9QMmAAAAMAAJ\u0026amp;pg\u003dPA215 page 215\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Why now, I expect,\u0026quot; said the American, \u0026quot;you would not shoot me in cold blood, although you are a Britisher, I guess.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("britishism", "{\"term\":\"britishism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|British|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word, phrase, idiom, or expression peculiar to the English language as spoken chiefly in Great Britain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("britishness", "{\"term\":\"britishness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|British|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being British\", \"priority\":1}]}, \"synonyms\":{}}");

	add("briton", "{\"term\":\"briton\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027breton\u0027 from Latin \u0027britto\u0027 or its Celtic equivalent (compare Welsh \u0027brython\u0027 .\u0026lt;!--\u0027From Anglo-Saxon \u0027\u0027Bryton\u0027\u0027 or \u0027\u0027Briton\u0027\u0027, an inhabitant of Britain (or of Britany, which was sometimes used interchangeably with Britain). All these originate from the Ancient British *\u0027\u0027Brittānos\u0027\u0027 (pl.\u0027\u0027Brittānī\u0027\u0027). The short form \u0027\u0027Brit\u0027\u0027 (or \u0027\u0027Bryt\u0027\u0027) apparently was used during the Saxon era.\u0027--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inhabitant of Great Britai\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A citizen of the United Kingdo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Celtic inhabitant of southern Great Britain at the time of the Roman conquest\", \"priority\":3}]}, \"synonyms\":{}}");

	add("britpop", "{\"term\":\"britpop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|Brit|pop|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A British alternative rock movement from the mid-1990s, characterised by influences from the 1960s and 1970s, catchy hooks, the glamour of earlier pop stardom, and the sense of creating a soundtrack to the lives of a new generation of British youth\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brittany", "{\"term\":\"brittany\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027brittania\u0027 presumably from Celtic. Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A region in north-west France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1595\u0027\u0027, \u0027King Henry VI, part 3\u0027, First Folio 1623, Act II, Scene VI\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"First, will I see the Coronation, / And then to \u0027\u0027Britanny\u0027\u0027 Ile crosse the Sea, / To effect this marriage, so it please my Lord\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The British Isles\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.11\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The noble Thamis […] seem\u0027d to stoupe afore / With bowed backe, by reason of the lode / And auncient heavy burden which he bore / Of that faire City, wherein make abode / So many learned impes, that shoote abrode, / And with their braunches spred all \u0027\u0027Britany\u0027\u0027 […\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"popular in the United States in the 1980s and 1990s\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027 , \u0027Friend of My Youth\u0027, ISBN 0679729577, page 102\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"No one has family names. These girls with rooster hair I see on the streets. They pick the names. They\u0027re the mothers.\u0026quot; \u0026quot;I have a granddaughter named \u0027\u0027Brittany\u0027\u0027,\u0026quot; Hazel said. \u0026quot; And I have heard of a little girl called Cappuccino.\u0026quot; \u0026quot;Cappuccino! Is that true? Why don\u0027t they call one Cassaulet? Fettuccini? Alsace-Lorraine?\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 , \u0027Lost Girls\u0027: Chapter Ten\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Names of the times. Borrowed from soap opera characters of prominence fifteen years ago, who have since been replaced by spiffy new models: the social-climbing \u0027Brittany\u0027 now an unscrupulous \u0027Burke\u0027, the generous \u0027Pamela\u0027 a refitted, urbanized \u0027Parker\", \"priority\":11}]}, \"synonyms\":{}}");

	add("brittlegill", "{\"term\":\"brittlegill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brittle|gill|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mushroom of the genus \u0027Russula\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brittleness", "{\"term\":\"brittleness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|brittle|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property by virtue of which a material is fractured without appreciable deformation by the application of load\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being brittle; aptness to break; fragility\", \"priority\":2}]}, \"synonyms\":{}}");

